data = ""

cil = ""

def find_duplicate(kamo):
    duplikat = False
    for i in kamo:
        if i in kamo.replace(i,"",1):
            duplikat = True
    return duplikat


for index, char in enumerate(data):
    slovo = data[index:index+14]
    if char in slovo:
        if find_duplicate(slovo) == False and cil == "":
            print(index+14)
            cil = index+14
            print(cil,"je toto")



